BigTitsAtSchool - Briana Blair (Slut Student Fucks The Popular Guy)

Briana is a very gullible student and Johnny wants to take advantage of it. He explains to her that the dean sometimes goes on the PA system and requests the students to perform certain tasks. Briana makes nothing of it. As soon as they leave, they test out the PA system. They start by making Briana do little tasks to see if she'll listen. When they see that she does, they see how far they can go. Johnny eventually has his way with the ditsy freshman.
